<svelte:options immutable />

<script lang="ts">
	import { onMount } from 'svelte';
	import {
		createCatImageStore
	} from '../stores';

	import CatCardsGrid from '../../components/CatCardsGrid.svelte';

	import type { StoreCatImages } from '../../models/models';


	let catImages: StoreCatImages;
	let catImages2: StoreCatImages;

	$: cuteAndQuirkyCatImages = [
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'data:image/jpeg;base64,',
		'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSoqg81CKa9KtcYbBX_M2Ig3e8SZ9-h0wP2Pw&usqp=CAU',
		'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTA8i2U4EMROhYKClQo79vM787Ai6S6W-GzHQ&usqp=CAU',
		'data:image/jpeg;base64,',
		'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcREp4csdfsx14u1OiAAEMTjHGDzbfdJPa4fhg&usqp=CAU'
	];

	onMount(async () => {
		fetch("https://api.thecatapi.com/v1/images/search?limit=10")
			.then(res => res.json())
			.then(data => catImages2 = createCatImageStore(data.map(i => i.url)))
			.catch(e => {
				console.log(e)
				return [];
			});

		catImages = createCatImageStore(cuteAndQuirkyCatImages);
		catImages2 = createCatImageStore(cuteAndQuirkyCatImages)
	});
</script>

<svelte:head>
	<title>Tutorial</title>
	<meta name="description" content="Tutorial" />
</svelte:head>

<div>

	<h1 class="welcome">{@html 'Hello <strong>User-X!</strong>'}</h1>

	<h1>Cats from a local list:</h1>
	<CatCardsGrid store={catImages} />

	<h1>Cats from an API:</h1>
	<CatCardsGrid store={catImages2} />
</div>


